window.bookSummaryJSON = "<p>As Murmur reels in the wake of the secret her friends tried to keep, her grip on what is real and what is virtual begins to slip. What's more, she's no longer sure whom she can trust.</p> <p>Stalked across the continent by a rogue with a vendetta, Murmur is forced to dig deep and develop her abilities before she finds a knife in her back.</p> <p>Suspicion surrounds the AIs as well. Their behaviors are too human, their reports too perfect. Shayla and Laria must uncover the truth before the system raises concerns and Murmur is lost forever.</p>"; 
